import React from "react";
//import './ImgLinkForm.css';

const FaceRecognition = (props) => {
    console.log("FaceRecognition ", this.props.imgUrl);
    return (
        <div className="center" style={{marginTop: "5px", marginBottom: "5px", width: "470px", height: "auto"}}>
            <img alt="" src={this.props.imgUrl}/>

        </div>
    );
}

export default FaceRecognition;
